import { Header } from "./components/Header";
import { Listas } from "./components/Listas";
import { Pesquisa } from "./components/Pesquisa";
import { GlobalStyle } from "./styles/global";

export function App() {
  return (
    <>
      <GlobalStyle />
      <div>
      <Header />
      <Pesquisa />
      <Listas />
    </div>
    </>
  );
}
